function Card(props) {
    return (
        <>
            <div className='card_container'>
                <div className='img'>
                    <img src={props.imagesrc} alt='image'></img>
                </div>
                <h4>{props.ctitle}</h4>
                <h3>{cards.stitle}</h3>
                <button>Watch Now</button>
            </div>
        </>
    )
}

export default Card;
